                Swal.fire(
                    'Ops',
                    data.message,
                    'warning'
                );
            }
        });
    }

    $(document).ready(function () {
        var sexoVal = $('#sexoVal').val();
        $('#Sexo').val(sexoVal).change();
    });

    $(document).ready(function () {
        $('#Cpf').mask('000.000.000-00');
